import { Link } from 'react-router-dom';

function Table() {




    const workers = [
      { name: 'Конюхов Антон Владимирович', greid: '10', salary: 120000, post: 'главный менеджер'},
      { name: 'Саянов Виктор Олегович', greid: '5', salary: 90000, post: 'менеджер'},
      { name: 'Конюхов Антон Владимирович', greid: '10', salary: 120000, post: 'главный менеджер'},
      { name: 'Саянов Виктор Олегович', greid: '5', salary: 90000, post: 'менеджер'},
      { name: 'Конюхов Антон Владимирович', greid: '10', salary: 120000, post: 'главный менеджер'},
      { name: 'Саянов Виктор Олегович', greid: '5', salary: 90000, post: 'менеджер'},
      { name: 'Конюхов Антон Владимирович', greid: '10', salary: 120000, post: 'главный менеджер'},
      { name: 'Саянов Виктор Олегович', greid: '5', salary: 90000, post: 'менеджер'},
    ];

    let html = "";
    for(let i = 0; i < workers.length; i++){
        html += "<tr>" 
            + "<td>" + workers[i].name + "</td>"
            + "<td>" + workers[i].greid + "</td>"
            + "<td>" + workers[i].salary + "</td>"
            + "<td>" + workers[i].post + "</td>"
            + "</tr>";
    }


  return (
    <div class="table-responsive">
    <table class="table table-striped table-bordered">

        <thead class="table-dark">
            <tr>
                <td>ФИО</td>
                <td>грейд</td>
                <td>зарплата</td>
                <td>должность</td>
            </tr>
        </thead>

        <tbody id="workers-table" dangerouslySetInnerHTML={{__html: html}}>
        </tbody>
    </table>
    </div>
  );

}

export default Table;
